import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first product card to be visible
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Locate the first product card
    const firstProductCard = page.locator('.product-card').first();

    // Extract the title of the first product
    const productTitle = await firstProductCard.locator('.product-title').textContent();

    // Find and click the "Add to Cart" button for the first product
    const addToCartButton = firstProductCard.locator('button.add-to-cart');
    await addToCartButton.click();

    // Wait for the success notification to appear
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take a screenshot after adding the product to the cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_added.png'));

    // Extract data for verification
    const notificationText = await page.locator('.notification.success').textContent();
    const cartText = await page.locator('div.cart').textContent();

    return {
      success: true,
      action: "Added the first product to the cart and verified the success notification.",
      extractedData: {
        addedProductTitle: productTitle.trim(),
        notificationMessage: notificationText.trim(),
        cartDisplayText: cartText.trim().replace(/\s+/g, ' ') // Normalize whitespace
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, take a final screenshot if possible
    try {
      const errorPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorPath });
      screenshots.push(errorPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to add the first product to the cart.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
